import React from "react";
import { Link } from "react-router-dom";
import "./nearby.css";

const Nearby = () => {
  return (
    <div className="container_top">
      <div className="content_container_top">
        "Traveling to nearby places is like turning the page of a thrilling
        adventure novel every chapter reveals new experiences and exciting
        surprises."
      </div>

      <div className="container">
        <div >
          <p className="content_container">Top 9 BEST places to visit near TIRUPATI</p>
        </div>
        
      </div>
    </div>
  );
};

export default Nearby;
